--------------------------------------------------------- 
--        SEARLOC v1.1                                 --
---------------------------------------------------------
-- installs or re-installs searloc library to database --
---------------------------------------------------------

CREATE PROCEDURE dbo.searloc_install AS
BEGIN
-- REMOVE PREVIOUS INSTALLATION
DECLARE @SQL NVARCHAR(MAX) = '';
SELECT @SQL = @SQL +
'DROP ' 
+ CASE 
   WHEN o.type  IN ('P', 'PC') THEN 'PROCEDURE' 
   WHEN o.type  IN ('TA') THEN 'TRIGGER' 
   ELSE 'FUNCTION' 
 END
+ ' [' + s.name + ']'
+ '.[' + o.name + ']' 
+ CHAR(13) 
FROM sys.assembly_modules m 
JOIN sys.assemblies a ON a.assembly_id = m.assembly_id 
JOIN sys.Objects o ON o.object_id = m.object_id 
JOIN sys.schemas s ON s.schema_id = o.schema_id
WHERE a.name = 'searloc' 
EXEC (@SQL)
 
IF EXISTS(SELECT * FROM sys.assemblies a WHERE a.name = N'searloc') DROP ASSEMBLY [searloc]
 
 
-- CREATE SCHEMA 'searloc' IF NOT EXISTS  
IF NOT EXISTS(SELECT 1 FROM sys.schemas WHERE name='searloc') EXEC('CREATE SCHEMA searloc')
 

-- INSTALL CLR
DECLARE @dbname varchar(500)=quotename(db_name()) 
EXEC('ALTER DATABASE '+@dbname+' SET TRUSTWORTHY ON')
EXEC('ALTER AUTHORIZATION ON DATABASE::'+@dbname+' TO sa')
EXEC sp_configure 'clr enabled' , '1'; RECONFIGURE;
CREATE ASSEMBLY [searloc]
FROM 
WITH PERMISSION_SET = SAFE
 
EXEC('CREATE PROCEDURE [searloc].[install] WITH EXECUTE AS CALLER AS EXTERNAL NAME searloc.clr.install')
 
EXEC [searloc].[install] 
 
 
END
